import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import Dashboard from './components/Dashboard';
import Transcript from './components/Transcript';
import RegisterCourses from './components/RegisterCourses';
import SwapSection from './components/SwapSection';
import ResetPassword from './components/ResetPassword';  
import EnrolledCourses from './components/EnrolledCourses';
import AdminLogin  from './components/AdminLogin';
import AdminDashboard from './components/AdminDashboard';
import ChangeCourse    from './components/ChangeCourse'
import ChangeSection    from './components/ChangeSection'
import ChangeStudent    from './components/ChangeStudent'
import ChangeTeacher    from './components/ChangeTeacher'

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/transcript" element={<Transcript />} />
        <Route path="/register" element={<RegisterCourses />} />
        <Route path="/swap" element={<SwapSection />} />
        <Route path="/reset-password" element={<ResetPassword />} /> 
        <Route path="/enrolled-courses" element={<EnrolledCourses />} />
        <Route path="/admin" element={<AdminLogin />} />
        <Route path="/AdminDashboard" element={<AdminDashboard />} />
        <Route path="/changecourse" element={<ChangeCourse />} />
        <Route path="/changesection" element={<ChangeSection />} />
        <Route path="/changestudent" element={<ChangeStudent />} />
        <Route path="/changeteacher" element={<ChangeTeacher />} />
      </Routes>
    </Router>
  );
}

export default App;
